from gym import spaces, Env
import numpy as np

class BaseEnv(Env):
    metadata = {'render.modes': ['human']}

    def __init__(self, reads, microgenome):
        #super(BaseEnv, self).__init__()
        self.reads = reads
        self.microgenome = microgenome
        self.n_reads = len(self.reads)
        self.action_space = spaces.Discrete(self.n_reads)
        low = np.zeros((self.n_reads,), dtype=np.int32) - 1
        high = np.zeros((self.n_reads,), dtype=np.int32)
        high.fill(self.n_reads)
        self.observation_space = spaces.Box(low, high, dtype=np.int32)
        self.reset()

    def reset(self):
        self._cur_pos = 0
        self.cur_state = np.zeros((self.n_reads,), dtype=np.int32) - 1
        return self.cur_state

    def _is_terminal(self, obs):
        control = np.zeros(self.n_reads, dtype=np.int32)
        for read_id in obs:
            control[read_id] = 1
        return np.count_nonzero(control) == self.n_reads

    def _is_absorbing(self, obs):
        for o in obs:
            if o == -1:
                return False
        return True

    def _compute_reward(self, state, done):
        pass

    def step(self, action):
        _next = np.zeros(self.n_reads, dtype=np.int32) - 1
        for i in range(self._cur_pos):
            _next[i] = self.cur_state[i]
        # set current action into next state
        _next[self._cur_pos] = action
        # set next state as current state
        self.cur_state = _next
        self._cur_pos += 1
        obs = self.cur_state
        done = self._is_absorbing(obs)
        reward = self._compute_reward(obs, done)
        info = None
        return obs, reward, done, info

    def render(self, mode='human', close=False):
        print(self.cur_state)

class BaseEnvV1(BaseEnv):
    def __init__(self, reads, microgenome):
        super().__init__(reads, microgenome)
        self.overlap_buffer = {}
        
    def _compute_reward(self, state, done):
        if not done or not self._is_terminal(state):
            return 0.1
        acc = 0.0
        last = None
        for read_id in state:
            if last is not None:
                acc += self._get_overlap(last, read_id)
            last = read_id
        return acc

    def _get_cached_overlap(self, read1, read2):
        if read1 in self.overlap_buffer and read2 in self.overlap_buffer[read1]:
            return self.overlap_buffer[read1][read2]
        if read2 in self.overlap_buffer and read1 in self.overlap_buffer[read2]:
            return self.overlap_buffer[read2][read1]
        return None

    def _get_overlap(self, read1, read2):
        o_val = self._get_cached_overlap(read1, read2)
        if o_val is None:
            s1 = self.reads[read1]
            s2 = self.reads[read2]
            o_val = self._get_sw_score(s1, s2)
            self._cache_overlap(read1, read2, o_val)
        return o_val

    def _cache_overlap(self, read1, read2, value):
        if read1 not in self.overlap_buffer:
            self.overlap_buffer[read1] = {}
        self.overlap_buffer[read1][read2] = value
        
    def _get_sw_matrix(self, i, j, matrix, s1, s2, match, mismatch, gap):
        score = match if s1[i-1] == s2[j-1] else mismatch
        return max(
            matrix[i-1][j-1] + score,
            matrix[i-1][j] + gap,
            matrix[i][j-1] + gap,
            0
        )

    def _get_sw_score(self, s1, s2, match = 1.0, mismatch = -0.33, gap = -1.33):
        l = len(s1)+1
        c = len(s2)+1
        matrix = np.array([0.0 for _ in range(l * c)]).reshape(l, c)
        for i in range(1, l):
            for j in range(1, c):
                matrix[i][j] = self._get_sw_matrix(i, j, matrix, s1, s2, match, mismatch, gap)
        return np.max(matrix)        

class BaseEnvV2(BaseEnv):
    def __init__(self, reads, microgenome):
        super().__init__(reads, microgenome)
        self.overlap_buffer = {}
        self.factor = 1.0 / (self.n_reads * max([len(x) for x in reads]))
        
    def _compute_reward(self, state, done):
        acc = 0.0
        last = None
        for read_id in state:
            if read_id == -1:
                break
            if last is not None:
                acc += self._get_overlap(last, read_id)
            last = read_id
        acc *= self.factor
        acc += 1.1 if self._is_terminal(state) else 0.1
        return acc

    def _get_overlap(self, left_id, right_id):
        if left_id < 0 or left_id >= self.n_reads:
            return 0
        if right_id < 0 or right_id >= self.n_reads:
            return 0
        left_str = self.reads[left_id]
        right_str = self.reads[right_id]
        return self._compute_overlap(left_str, right_str)[1]
        
    def _compute_overlap(self, left_read, right_read):
        for i in range(len(left_read)):
            l = left_read[i:]
            size = len(l)
            r = right_read[:size]
            if l == r:
                return l, size
        return "", 0

